import React from 'react'
import MySelect from './mySelect'
import goods from '../../db/goods'


const Socket = ({ socket, onSelect }) => {
    const goodList = goods.filter(good => good['Количество'] !== '0')

    const variants = ['Любой']
    goodList.forEach(good => {
        if(good['Артикул'][0] === '0' || good['Артикул'][0] === '1') {
            if(!variants.includes(good['Сокет'])) {
                variants.push(good['Сокет'])
            }
        }
    })
    variants.sort()

    return <MySelect title={'Сокет'} variants={variants} variant={socket} onSelect={onSelect} />
}

export default Socket
